import logo from './logo.svg';
import './App.css';
import React from 'react';


class Nav extends React.Component {
  render() {
    return(
      <nav>
        <ul>
          <li><button>Наверх</button></li>
        </ul>
        <input type="text" className="" placeholder='Поиск' />
      </nav>
    )
  }
}

function FileBlock (props) {
  return(
    <div className="Block">


    </div>
  )
}


class List extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      files: props.files      
    }
  }

  render() {
    return (
      <div className="list">
        {this.state.files.map((file) => {
          return (
            <List file={file}/>
          )
        })}
      </div>
    )
  }

}




class App extends React.Component {
  render() {
    return(
      <div className="App">
        <Nav />
      </div>
    )
  }
}

export default App;
